pragma solidity ^0.4.19;

contract CarreraDeCaballos {

    struct Caballo {
        string nombre;
        uint raza;
        uint edad;
    }

    Caballo[] caballos;

    function crearCaballo(string _nombre, uint _raza, uint _edad) {
        caballos.push(Caballo(_nombre, _raza, _edad));
    }

    function raza(string _str) private view returns (uint) {
       uint aleat = uint(keccak256(_str));
       return aleat % 100;
    }
}

